void rec(int y, int x){
    if(x==n){
        y++; x=y+1;
    }


    if(team[y].won>(n/2));
    else if(team[y].lost>(n/2));
    else if(y==n-2 && x==n-1){
        cnt++;
    }
    else{
        if(map[y][x]!=0){
            rec(y,x+1);
        }
        else{
            if(team[y].won<(n/2)){
                team[y].won++;
                team[x].lost++;
                map[y][x]=map[x][y]=1;
                rec(y,x+1);
                map[y][x]=map[x][y]=0;
                team[y].won--;
                team[x].lost--;
            }

            if(team[y].lost<(n/2)){
                team[y].lost++;
                team[x].won++;
                map[y][x]=map[x][y]=1;
                rec(y,x+1);
                map[y][x]=map[x][y]=0;
                team[y].lost--;
                team[x].won--;
            }
        }
    }
}
